import React, { useState } from 'react';
import {BrowserRouter, Route} from "react-router-dom";

const MainContent = () => {

    return(
        <div className="mb-3 col-md-8">
            <BrowserRouter>
                <Route exact path="/">
                    <UniversalForm />
                </Route>
                <Route exact path="/hello">
                    worls
                </Route>
            </BrowserRouter>
        </div>
    );
}

export default MainContent;
